import React from 'react';
import styled from 'styled-components';
import UserInfo from './UserInfo';
import Summary from './Summary';
import Experiences from './Experiences';

const Wrapper = styled.div`
  display: block;
  padding 24px;
`

export default () => (
  <Wrapper>
    <UserInfo/>
    <Summary/>
    <Experiences/>
  </Wrapper>
)
